<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Weak Map</title>
</head>
<body>
    
    <script>
        let a={'a':10}, b={'b':5}
        let weakmap=new WeakMap([[a,76],[b,34]]);
        console.log(weakmap);
        console.log(weakmap.get(a));
    </script>
    
</body>
</html>
